import React from 'react';

class ImageBox extends React.Component {
	constructor(props){
		super(props);
		this.image = props.ImgUrl
	}
	render(){
		console.log(this.image);
		if(this.image!==''){
				return(
					<div className="imageContainer">
						<canvas className="canvas"/ >
						<img className='imagebox pa1' src={this.image} alt='Please enter a valid URL.'/>
					</div>
					)
			} else {
				return (<div/>)
			}
	}
}

export default ImageBox;
